INSERT INTO `review` VALUES (38,'Good foundation course','This course provided a solid foundation for mathematics. The professor was patient and took time to explain difficult concepts. The homework was manageable and helped reinforce learning.',0,0,0,'2025-04-16 09:35:00',5,2,4,3,4,NULL,4441),(39,'Helpful but challenging','General Mathematics was more difficult than I expected. The professor moves quickly through material, so you need to stay on top of things. Office hours were extremely helpful for clarifying concepts.',0,0,0,'2025-04-17 13:20:00',12,4,2,3,4,NULL,4444),(51,'Algebra made clear','The professor has a gift for making abstract concepts understandable. The course was well-structured with plenty of practice problems. Tutorials were particularly useful for working through challenging examples.',0,0,0,'2025-04-18 11:15:00',8,3,3,4,5,NULL,4450),(52,'Calculus is fascinating','This course opened my eyes to the beauty of calculus. The professor was passionate and engaging. Homework was challenging but well-designed to help understand the material deeply.',0,0,0,'2025-04-16 14:40:00',22,4,3,5,5,NULL,4453),(53,'Practical math applications','Computational Mathematics connected theory to real-world applications effectively. The programming components were particularly useful. Some assignments were unclear, but overall a valuable course.',5,0,0,'2025-04-17 10:30:00',15,3,3,4,4,0000000001,4456),(54,'Built on fundamentals well','General Mathematics 2 expanded nicely on the first course. The professor was clear and methodical. Weekly quizzes kept me engaged and helped identify areas needing more study.',0,0,0,'2025-04-18 16:25:00',27,3,3,3,4,NULL,4468),(55,'Challenging but rewarding','This course pushed my mathematical understanding to new levels. The workload was heavy, but concepts built on each other logically. The professor was demanding but fair with grading.',2,0,0,'2025-04-16 11:50:00',3,5,2,3,4,NULL,4470),(56,'Essential for engineers','Differential Equations is a must-take course for anyone in engineering. The applications were relevant and interesting. The professor made a potentially dry subject engaging with real-world examples.',0,0,0,'2025-04-17 09:15:00',19,4,2,4,5,NULL,4481),(57,'Education focus helpful','As someone interested in teaching math, this course was invaluable. It provided practical strategies for explaining mathematical concepts. The group projects were particularly insightful.',0,0,0,'2025-04-18 13:40:00',11,2,4,4,5,0000000001,4490),(58,'Rigorous but necessary','Real Analysis is not for the faint-hearted. The proofs require careful thinking and precision. The professor was demanding but available to help during office hours. Essential for pure math students.',4,0,0,'2025-04-17 14:35:00',7,5,1,2,4,NULL,4509),(59,'Beautiful connections','This course elegantly connects real and complex analysis. The professor has a gift for making difficult concepts clear. The assignments were challenging but designed to deepen understanding rather than just test memorization.',2,0,0,'2025-04-18 10:05:00',14,4,3,4,5,0000000001,4520),(60,'Great intro to coding','Perfect course for beginners. The professor was patient and provided clear examples. Weekly labs reinforced lecture material effectively. Assignments were challenging but not overwhelming.',0,0,0,'2025-04-16 13:25:00',2,2,4,4,5,NULL,1409),(61,'Solid foundation','Introduction to Computer Systems provided essential knowledge for all CS students. The professor explained complex concepts clearly. Labs were sometimes frustrating but ultimately rewarding.',0,0,0,'2025-04-17 11:40:00',18,3,3,3,4,0000000001,1412),(62,'Math heavy but necessary','This course connects mathematics to computer science fundamentals. Some topics were abstract and challenging. The professor was knowledgeable but sometimes moved too quickly through difficult concepts.',3,0,0,'2025-04-18 14:50:00',9,4,2,3,4,NULL,1420),(63,'Essential programming skills','This course builds fundamental programming concepts systematically. The assignments were practical and engaging. The professor provided helpful feedback on coding style and efficiency.',0,0,0,'2025-04-16 10:15:00',21,3,3,4,5,NULL,1422),(64,'Hardware fundamentals','Computer Organisation covers essential concepts about how computers actually work. The labs with physical components were particularly valuable. Be prepared for detailed technical content.',0,0,0,'2025-04-17 15:30:00',13,4,2,3,4,NULL,1425),(65,'Critical for all CS majors','Understanding algorithms is essential, and this course delivers. The professor explained complex concepts clearly with good examples. Programming assignments were challenging but reinforced theoretical concepts well.',11,0,0,'2025-04-18 09:45:00',28,4,2,3,5,NULL,1430),(66,'OOP concepts well taught','The professor made object-oriented concepts accessible and practical. Project work helped solidify abstract ideas. Consistent practice is necessary to master the material.',12,0,0,'2025-04-16 17:10:00',4,3,3,4,5,NULL,1121),(67,'Advanced but valuable','Applied Algorithmics takes algorithms to the next level. The course was demanding but extremely valuable. The professor had high expectations but was supportive throughout.',0,0,0,'2025-04-17 12:05:00',16,5,2,3,5,0000000001,1140),(68,'Modern web development','This course provides practical skills for modern web development. The project-based approach was effective for learning. Some technologies covered were slightly outdated, but core concepts remain relevant.',0,0,0,'2025-04-18 15:55:00',29,3,3,4,4,NULL,1147),(69,'User-centered design','Human-computer Interaction taught valuable principles for designing usable systems. The group projects provided practical experience. The professor brought in interesting real-world examples.',0,0,0,'2025-04-16 14:20:00',6,2,4,4,5,0000000001,1159),(70,'Database fundamentals','This course provided a strong foundation in database concepts. The SQL assignments were practical and relevant. The professor explained theoretical concepts clearly with good examples.',4,0,0,'2025-04-17 16:35:00',23,3,3,3,4,NULL,1165),(71,'AI fundamentals','An excellent introduction to artificial intelligence concepts. The programming assignments were challenging but fascinating. The professor was clearly passionate about the field and made complex topics accessible.',0,0,0,'2025-04-18 11:30:00',10,4,3,5,5,NULL,1171),(72,'Clear introduction','Accounting Information provides a solid foundation for business students. The professor used relevant examples to illustrate concepts. Weekly tutorials helped reinforce lecture material effectively.',0,0,0,'2025-04-16 09:50:00',26,2,3,3,4,NULL,10),(73,'Practical foundation','This course built nicely on Accounting Information. The exercises were practical and relevant. The professor was approachable and provided helpful feedback on assignments.',6,0,0,'2025-04-17 14:15:00',1,3,3,3,4,NULL,11),(74,'Detailed financial concepts','Financial Accounting dives deep into important accounting principles. The workload was significant but manageable. The professor had high standards but was fair with grading.',0,0,0,'2025-04-18 10:40:00',17,4,2,3,4,NULL,13),(75,'Management perspective','This course provided valuable insights into how accounting informs management decisions. The case studies were particularly useful. The professor brought real-world experience to the classroom.',0,0,0,'2025-04-16 15:05:00',24,3,3,4,5,0000000001,14),(76,'Systems approach useful','Understanding accounting information systems is essential in today\'s business environment. The software components were practical and relevant. Some assignments were unclear, but the professor was helpful in clarifying.',0,0,0,'2025-04-17 11:25:00',8,3,3,3,4,NULL,15),(77,'Advanced concepts','Advanced Financial Accounting builds on earlier courses effectively. The professor had high expectations but was supportive. Case studies helped connect theory to practice.',4,0,0,'2025-04-18 16:10:00',20,4,2,3,4,NULL,17),(78,'Audit fundamentals','This course provides essential knowledge for anyone interested in auditing. The professor brought in real-world examples from practice. Group assignments simulated actual audit scenarios effectively.',0,0,0,'2025-04-16 12:30:00',5,4,2,3,5,0000000001,18),(79,'Strategic thinking','Strategic Management Accounting connects accounting to broader business strategy. The case-based approach was effective and engaging. The professor facilitated excellent discussions.',0,0,0,'2025-04-17 09:55:00',14,3,3,4,5,NULL,19),(80,'Performance insights','This course provides valuable frameworks for measuring organizational performance. The group project was particularly insightful. The professor was demanding but fair with feedback.',5,0,0,'2025-04-18 13:20:00',27,4,2,3,4,NULL,20),(81,'Revenue management','Important concepts for understanding revenue and cost relationships. The professor explained complex topics clearly. Case studies helped illustrate theoretical concepts effectively.',0,0,0,'2025-04-16 16:45:00',3,3,3,3,4,NULL,21),(82,'Statement analysis skills','Financial Statement Analysis provides essential skills for finance and accounting professionals. The assignments were practical and relevant. The professor had high standards but was supportive.',0,0,0,'2025-04-17 13:10:00',19,4,2,3,5,NULL,22),(83,'Governance insights','This graduate-level course provided valuable perspectives on accounting\'s role in governance. Discussions were thought-provoking and engaging. The professor brought in current issues and cases.',0,0,0,'2025-04-18 09:35:00',11,4,3,4,5,NULL,26),(84,'Engaging introduction','This course provided a fascinating overview of psychology. The professor was engaging and used interesting examples. Assignments encouraged application of concepts rather than mere memorization.',0,0,0,'2025-04-16 10:55:00',22,2,4,5,5,NULL,5929),(85,'Mind and brain basics','Mind, Brain and Behaviour introduces fundamental concepts clearly. The professor connected neuroscience to behavioral outcomes effectively. The labs were particularly valuable for understanding brain structures.',2,0,0,'2025-04-17 15:20:00',7,3,3,4,5,0000000001,5931),(86,'Perception foundations','This course explores how we perceive and process information. The experiments and demonstrations were fascinating. Some concepts were challenging but the professor explained them well.',0,0,0,'2025-04-18 11:45:00',15,3,3,4,5,NULL,5937),(87,'Biological insights','Biopsychology connects psychological processes to biological mechanisms. The content was dense but fascinating. The professor used excellent visuals to explain complex brain processes.',0,0,0,'2025-04-16 14:05:00',28,4,2,4,5,NULL,5939),(88,'Behavioral foundation','Learning and Behaviour explores fundamental principles of how we learn. The experiments discussed were fascinating. The professor connected theories to practical examples effectively.',3,0,0,'2025-04-17 10:30:00',9,3,3,4,5,0000000001,5941),(89,'Social dynamics','Social Psychology provides fascinating insights into human interaction. The class discussions were engaging and thought-provoking. The professor brought research to life with relevant examples.',0,0,0,'2025-04-18 16:55:00',23,2,4,5,5,NULL,5943),(90,'Personality insights','Theories of Personality and Development covers major theoretical frameworks effectively. The professor encouraged critical thinking rather than memorization. Case studies helped illustrate abstract concepts.',0,0,0,'2025-04-16 11:15:00',2,3,3,4,5,NULL,5945),(91,'Advanced cognition','Cognitive Science integrates psychology, neuroscience, and computing perspectives. The content was challenging but fascinating. The professor was clearly an expert in the field and presented material clearly.',0,0,0,'2025-04-17 13:40:00',16,4,2,4,5,NULL,5963),(92,'Neuroscience depth','Human Neuroscience dives deeper into brain structures and functions. The content was detailed and sometimes challenging. The professor used excellent visuals and m